div.pre:
.card a{
    width: 300px;
    height: 300px;
    display: inline-block;
    border-radius: 10px;
    position: relative;
    margin-top: 20px;
    line-height: 0;
}

.card a:hover {
    cursor: pointer;
}

.card a::after,
.card a::before {
    content: '';
    position: absolute;
    inset: 0;
    border-radius: 10px;
    opacity: 0;
    transition: opacity 200ms ease;
}

.card a::after {
    background-color: hsla(178, 100%, 50%, 0.5);
}

.card a::before {
    background: url(images/icon-view.svg) no-repeat center;
}

.card a:hover::after,
.card a:hover::before {
    opacity: 1;
}

